def verbose_show(image,tytul,debug=0):
	return 0
	if debug == 1:
		py.figure()
		py.title(tytul)
		py.imshow(image)


def gauss_kern(sigma):
    size=float(3*sigma);
    x, y = mgrid[-size:size:1, -size:size:1]
#    g =  exp(-((x**2+y**2)/2/sigma**2)) / sigma/ sqrt(2*3.14)
    g =  exp(-((x**2+y**2)/2/float(sigma)**2)) 
    #py.figure()
    #py.imshow(g);
    #py.title("Gauss kernel");
    return g/g.sum();

def blur2d(im,s):
    g = gauss_kern(s)
    improc = signal.convolve(im,g, mode='valid')
    return(improc)


def setScale(Scale,Unit):
	if Unit =="nm":
		return Scale;
	elif Unit =="Angstrom":
		return Scale/10;

