def 	toOneD(tab,rms,rozmiar=100,debug=0):
	
	linia=tab[0];
	if debug==1:
		py.figure();
		py.title("Otrzymany szum jednowymiarowy");
		py.plot(linia);

	FT=fftpack.fft(linia);
	if(rozmiar<FT.shape[0]):
		rozmiar=FT.shape[0];

	FT=hstack((hstack((FT[0:FT.shape[0]/2],zeros(rozmiar-FT.shape[0]))),FT[FT.shape[0]/2:]));
	if debug==1:
		py.figure();
		py.title("Sklejona transformata fouriera");
		py.plot(abs(FT));

	
	new=random.normal(scale=rms,size=rozmiar);

	nFT=fftpack.fft(new);
	nFT=nFT*FT
	new=fftpack.ifft(nFT);
	if debug==1:
		py.figure();
		py.title ("Wygenerowana linia");
		py.plot  (real(new));
	
	nsigma=std(tab);
	tab=tab/nsigma*rms;
	
	return reshape(tab,tab.shape[0]*tab.shape[1])



